import { observer } from 'mobx-react-lite';
import React, {Fragment, useContext, useEffect} from 'react'
import { NavLink } from 'react-router-dom';
import { Context } from '..';

import styles from './Menu.module.css';
const Master = () =>{
    const {master} =useContext(Context)
    return (
        <div className={styles.master}>
            <img src={process.env.REACT_APP_API_URL + master.image} alt={master.name} className={styles.photo} />
            <h2 className={styles.name}>{master.name}</h2>
            <p className={styles.description}>{master.description}</p>
            <img src={process.env.REACT_APP_API_URL + master.imageCut} alt={master.nameCut} className={styles.photo} />
            <h2 className={styles.name}>{master.nameCut}</h2>
            <p className={styles.description}>{master.descriptionOfCut}</p>
            <p className={styles.description}>{master.price} рублей</p>
            <NavLink>Записаться к мастеру на стрижку "{master.nameCut}"</NavLink>
        </div>
    );
};
export default Master
